import React, { useEffect, useState } from 'react';
import Navbar from '../AdminNavbar/AdminNavbar';
import { fetchAllUsers } from '../../../api/Api.js';
import { DataGrid } from '@mui/x-data-grid';



// const columns = [
//     { title: 'ID', field: '_id' },
//     { title: 'Full Name', field: 'fullname' },
//     { title: 'UserName', field: 'username' },
//     { title: 'Email', field: 'email' },
//     { title: 'Mobile Number', field: 'mobilenumber' },
//     { title: 'Membership', field: 'membership' },
//     { title: 'Car Ids', field: 'carId' },
 
// ];


const columns = [
    { field: 'id', headerName: 'ID', width: 170 },
    { field: 'name', headerName: 'NAME', width: 170 },
    { field: 'age', headerName: 'AGE', width: 170 },
  ];
    
  const rows = [
    { id: 1, name: 'Gourav', age: 12 },
    { id: 2, name: 'Geek', age: 43 },
    { id: 3, name: 'Pranav', age: 41 },
  ];


const AdminDashboard = () => {

    const [data, setData] = useState([]);


    const fetchallusers = async () => {
        const responce = await fetchAllUsers();
        // console.log(responce);
        console.log(responce.data);
        const allUsers =  responce.data;
        setData({allUsers});
        // console.log(data);
    }

    useEffect(() => {
        fetchallusers();
    }, []);

   console.log("data ",data);

    

    return (
        <>
            <Navbar />
            <h3>Admin Dashboard</h3>
            <div className="container">
                <DataGrid key={data._id} rows={data} columns={columns} pageSize={10} checkboxSelection />
            </div>

        </>
    )
}

export default AdminDashboard;
